import React from "react";
import { Page } from "../components/Page";
import CoCData from "../data/coc";

export function Partner({ myRef }) {
  return (
    <Page center={false} myRef={myRef} marginBottom={240}>
      <div className="title">
        <div className="heading-1">Creative Partner</div>
      </div>
      <div style={{ display: "grid", gridGap: 120, marginTop: 40 }}>
        <div style={{ display: "grid", gridGap: 40, gridTemplateColumns: "1fr 1fr" }}>
          <div>Logo</div>
          <div>
          <div>EO Studio</div>
          <div>EO는 국내 최고의 스타트업 영상 미디어이자 기업가 정신과 기회에서 이야기를 발굴하는 콘텐츠 스타트업입니다.
          창업, 취업, 진로, 교육, 임팩트 투자, 스타트업, 기업가 정신 등의 분야에 있어 최고의 영상제작과 스토리텔링 능력을 가지고 있습니다.</div>
          </div>
        </div>
        <div></div>
      </div>
    </Page>
  );
}
